import { Carousel } from "./carousel/carousel";

export const Homepage = () => {
  return (
    <div className="container mx-auto px-4">
      <div className="bg-[url('/path/to/your/image.jpg')] bg-cover bg-center h-[400px] flex items-center">
        <div className="ml-10 w-1/2">
          <h1 className="font-medium leading-tight text-5xl mb-3 text-slate-700">
            Let's find you a pet!
          </h1>
          <p className="text-lg">
            Use Pet Adoption Hub to find the newest member of your family.
          </p>
        </div>
      </div>

      <Carousel />

      <p className="w-10/12 my-5 text-lg font-bold mx-auto text-center">
        If you have any questions contact{" "}
        <a className="text-blue-800" href="mailto:sidnoor15@gmail.com">
          Siddiqua Noorien
        </a>
      </p>
    </div>
  );
};
